import React, { useState } from 'react'
import { Link } from 'react-router-dom';
import { NavTopics } from './NavTopics';
import { Button } from 'react-bootstrap';


const Navbaar = ()=>{ 

    const navItems = NavTopics.map(
        (i)=>{
            return (
                <Link className={i.DSlass} to={i.path} style={{textDecoration:'none'}}>
                    <Button varient={i.class}>
                        <span className="font-weight-bold">{i.label}</span>
                    </Button>
                </Link>
            )
        }
    )

    return (
        <div>
            <nav className="nav nav-tabs navbar navbar-expand bg-">
            {navItems}
            </nav>
        </div>
            ) 

}

export default Navbaar;
